function TrainsPanel({trainManager, focusOnTrainClick}) 
{
    const handleTrainClick = (train) =>
    {
      trainManager.focusOnTrain(train)
      focusOnTrainClick(train)
    };

    return (
      <>
        <h2>Active Trains</h2>
        {trainManager.trains.map((train, index) =>(
          <button key={index} onClick={() => handleTrainClick(train)}>
            {train.name}
          </button>
        ))}
      </>
    );
}

  
export default TrainsPanel;
